import Carousel from "./components/Carousel";

function App() {
  return (
    <div className="wrapper">
      <h1>Wisdom Tooth</h1>
      <p>
        Proverbs are the product of collective human experiences, reflecting the
        trials, tribulations, and triumphs of generations. They are invaluable
        linguistic gems that carry the weight of centuries of human experiences.
        They serve as reservoirs of wisdom.
      </p>
      <div className="proverb-setup-container">
        <Carousel />
      </div>
    </div>
  );
}

export default App;
